import styles from "./Result.module.css";
import resultEngine from "../../../assets/ResultEngine.png";
import resultDialog from "../../../assets/ResultDialog.png";

const Result = () => {
  return (
    <>
      <main className={styles.backGroundImg}>
        <div className={styles.topTitle}>
          <img
            src={resultDialog}
            alt="결과창 상단 대화창 이미지입니다."
            className={styles.dialog}
          />
          <div className={styles.titleMain}>프론트엔드 개발자</div>
          <img
            src={resultEngine}
            alt="결과창 젤 타이틀 이미지입니다."
            className={styles.engine}
          />
        </div>
        <div className={styles.titleBox}>
          <div className={styles.titleContent}>
            눈에 보이는 화면을 개발하는 프론트엔드. 디자이너, PM, 백엔드
            사이에서 구체적인 요구사항을 표현합니다. 보다 나은 사용자 경험(UX)를
            위해 개발합니다.
          </div>
        </div>
        <div>???</div>
      </main>
    </>
  );
};

export default Result;
